"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
class Tentacle(QWidget):

    def __init__(self):

        QWidget.__init__(self)

        self.nodes       = Tentacle_Nodes()

        self.__draw()

    def __draw(self):

        self.scene = QGraphicsScene()
        self.view  = QGraphicsView(self.scene)

        self.ly_main = QHBoxLayout()
        self.ly_main.addWidget(self.view)

        self.setLayout(self.ly_main)

        self.scene.setItemIndexMethod(QGraphicsScene.NoIndex)
        self.scene.setSceneRect(-200, -200, 400, 400)

        self.view.setCacheMode(QGraphicsView.CacheBackground)
        self.view.setViewportUpdateMode(QGraphicsView.BoundingRectViewportUpdate)
        self.view.setRenderHint(QPainter.Antialiasing)
        self.view.setTransformationAnchor(QGraphicsView.AnchorUnderMouse)

        self.view.scale(0.8, 0.8)
        self.view.setMinimumSize(400, 400)

    def add(self,parent,node):

        if None == parent:
            self.nodes.add(node)            
        else:      
            parent.add(node)     

    def walk(self,node=None):

        _walked_nodes = []

        if None == node:
            for _node in self.nodes:
                _walked_nodes += _node.walk()
        else:
            _walked_nodes = node.walk()

        return _walked_nodes

    def count(self,node=None):

        _depth = 1

        if None == node:
            for _node in self.nodes:
                _depth += _node.depth()
        else:
            _depth = node.depth()

        return _depth

    def depth(self,node=None):

        _depth = []

        if None == node:
            for _node in self.nodes:
                _depth += _node.depth()
        else:
            _depth = node.depth()

        return max(_depth)

    def render(self):

        for _node in self.nodes:

            _node.render(self.scene,0,0)

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
class Tentacle_Node(QGraphicsItem):

    def __init__(self,label="",icon=None):

        QGraphicsItem.__init__(self) 

        self.id          = uuid.uuid4().hex         # unique identifier of node
        self.label       = label                    # node label       

        self.nd_width    = 200                      # node shape width
        self.nd_height   = 50                       # node shape height 

        self.nd_x        = 0                        # node position x in scene
        self.nd_y        = 0                        # node position y in scene

        self.nd_x_radius = 20                       # node round rectangle x radius
        self.nd_y_radius = 15                       # node round rectangle y radius

        self.separator_width = 5                    # number of pixels between iner node items

        self.is_visible  = True                     # flag True if node is visible in scene
        self.nodes       = Tentacle_Nodes()         # children nodes

        self.bt_plus_proxy  = None
        self.lbl_icon_proxy = None
        self.scene          = None

        self.__draw_node()
        self.__draw_buttons()
        self.__draw_icon(icon)
        self.__draw_label()

    def __draw_node(self):

        self.setFlag(QGraphicsItem.ItemSendsGeometryChanges)
        self.setCacheMode(QGraphicsItem.DeviceCoordinateCache)
        self.setZValue(-1)

    def __draw_buttons(self):

        self.bt_plus  = Tentacle_Node_Button(Tentacle_ICON("plus"),Tentacle_ICON("plus_hover"),"")
        self.bt_minus = Tentacle_Node_Button(Tentacle_ICON("minus"),Tentacle_ICON("minus_hover"),"")

    def __draw_icon(self,icon):

        if None == icon:
            self.icon = Tentacle_PIXMAP("node")
        else:
            self.icon = icon

        self.lbl_icon = Tentacle_Node_Icon(self.icon)

    def __draw_label(self):

        self.lbl_lbl = Tentacle_Node_Label(self.label)

    def boundingRect(self):
        
        _rect = QRectF(0, 0, self.nd_width, self.nd_height)
        
        return _rect

    def paint(self,painter,option,wdg):

        _pen = QPen(QColor("#ffffff"), 0)

        painter.setPen(_pen)

        _gradient = QLinearGradient(0, 0, self.nd_width, self.nd_height)
        _gradient.setColorAt(0, QColor("#8a8b8c"))
        _gradient.setColorAt(1, QColor("#eaebed"))

        painter.setBrush(_gradient)

        painter.drawRoundedRect(0, 0, self.nd_width, self.nd_height, 20, 15)

    def shape(self):

        _path = QPainterPath()
        
        _path.addRoundedRect(0, 0, self.nd_width, self.nd_height, 20, 15)
    
        return _path

    def add(self,node):

        self.nodes.add(node)

    def walk(self):

        _walked_nodes = [self]

        for _node in self.nodes:

            _walked_nodes += _node.walk()

        return _walked_nodes

    def count(self):

        _depth = 1

        for _node in self.nodes:

            _depth += _node.depth()

        return _depth

    def depth(self,start=0):

        _depth = [start + 1]

        for _node in self.nodes:

            _depth += _node.depth(start + 1)

        return _depth

    def render(self,scene,x,y):

        self.nd_x  = x
        self.nd_y  = y
        self.scene = scene

        self.scene.addItem(self)

        self.__render_buttons()
        self.__render_icon()
        self.__render_label()

    def __render_buttons(self):

        self.bt_plus_proxy  = self.scene.addWidget(self.bt_plus)
        self.bt_plus_pos_x  = self.nd_width - self.bt_plus.width()
        self.bt_plus_pos_y  = self.nd_height / 2 - self.bt_plus.height() / 2
        self.bt_plus_proxy.setPos( self.bt_plus_pos_x, self.bt_plus_pos_y)

        self.bt_minus_proxy = self.scene.addWidget(self.bt_minus)
        self.bt_minus_pos_x = self.nd_width - self.bt_minus.width()
        self.bt_minus_pos_y = self.nd_height / 2 - self.bt_minus.height() / 2
        self.bt_minus_proxy.setPos(self.bt_minus_pos_x, self.bt_minus_pos_y)

        self.bt_minus.hide()

    def __render_icon(self):

        self.lbl_icon_proxy = self.scene.addWidget(self.lbl_icon)
        self.lbl_icon_pos_x = self.separator_width
        self.lbl_icon_pos_y = self.lbl_icon.height() / 2
        self.lbl_icon_proxy.setPos(self.lbl_icon_pos_x, self.lbl_icon_pos_y)

    def __render_label(self):

        self.lbl_lbl_proxy  = self.scene.addWidget(self.lbl_lbl)
        self.lbl_lbl_pos_x  = self.lbl_icon_pos_x + self.lbl_icon.width() + self.separator_width
        self.lbl_lbl_pos_y  = self.nd_height / 2 - self.lbl_lbl.height() / 2
        self.lbl_lbl_proxy.setPos(self.lbl_lbl_pos_x, self.lbl_lbl_pos_y)

        _text_limit = int((self.bt_plus_pos_x - self.lbl_icon_pos_x + self.lbl_icon.width())/12)

        if len(self.label) > _text_limit:
            self.lbl_lbl.setText(self.label[:(_text_limit - 1)] + "...")
        else:
            self.lbl_lbl.setText(self.label)

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
class Tentacle_Nodes(object):

    def __init__(self):

        self.objects = []

    def add(self,obj):

        self.objects.append(obj)  

    def __iter__(self):

        for obj in self.objects:

            yield obj

    def __getitem__(self,index):

        return self.objects[index]

    def __len__(self):

        return len(self.objects)

    def find_by_attribute(self,attribute,value):

        _object = None

        for _obj in self.objects:

            if getattr(_obj,attribute) == value:

                _object = _obj

        return _object

    def __contains__(self,obj):

        return obj.id in [_local_obj.id for _local_obj in self.objects]

