class Tentacle_Node_Icon(QLabel):

    def __init__(self,icon):

        QLabel.__init__(self)    

        _css  = """
            border: 0px solid gray;
            background-color: rgba( 255, 255, 255, 0% );
        """ 

        self.setStyleSheet(_css)

        self.setPixmap(icon)

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
class Tentacle_Node_Label(QLabel):

    def __init__(self,text):

        QLabel.__init__(self)    

        _css  = """
            border: 0px solid gray;
            background-color: rgba( 255, 255, 255, 0% );
        """ 

        self.setStyleSheet(_css)

        self.setToolTip(text)        

        _font = self.font()

        _font.setPointSize(7)

        _font.setBold(True)

        self.setFont(_font)

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
def Tentacle_ICON(name):

    global IMAGES

    #create pixmap from base64 data
    _pixmap = Tentacle_PIXMAP(name)

    #create icon
    _icon  = QIcon()
    _icon.addPixmap(_pixmap)

    return _icon

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
def Tentacle_PIXMAP(name):

    global IMAGES

    _barray = QByteArray()
    _barray_data = _barray.fromBase64(IMAGES[name].encode("utf-8"))

    #create pixmap from base64 data
    _pixmap = QPixmap ()
    _pixmap.loadFromData(_barray_data, "PNG")

    return _pixmap

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
IMAGES = {
            "node"         : "",
            "plus"         : "",
            "plus_hover"   : "",
            "minus"        : "",
            "minus_hover"  : "",
        }

